import React from 'react'
import "./app.css";
import Filter from './Filter';

const Navbar = ({ handleDelete, setShowModal, filteration, setFilter }) => {


    const filterNames = (name) => {
        setFilter(name);
    }
    return (
        <div>
            <nav className="navbar navbar-light bg-dark">
                <div>
                    <button type="button" className="btn btn-warning btn-floating myBtn">
                        <i className="fas fa-trash-can" onClick={handleDelete}></i>
                    </button>

                    <button type="button" className="btn btn-warning btn-floating myBtn">
                        <i className="fas fa-plus" onClick={() => setShowModal(true)}></i>
                    </button>
                  
                </div>
            </nav>
        </div>

    )
}

export default Navbar
